import React from 'react'
import classes from './exploreMenu.module.css'
import { menu_list } from '../../Assets/frontend_assets/assets'
function ExploreMenu() {
  return (
    <div className={classes.explore_menu} id={classes.explore_menu}>
      <h1>Explore our menu.</h1>
      <p className={classes.explore_menu_text}>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Sint at unde ullam saepe iusto ex atque</p>
      <div className={classes.explore_menu_list}>
          {
            menu_list.map((item, index) => (
              <div key={index} className={classes.explore_menu_item}>
                <img src={item.image} />
                <p>{item.menu_name}</p>
              </div>
            ))
          }
      </div>
    </div>
  )
}

export default ExploreMenu
